import React from "react";
import styled from "styled-components";
import { Categories } from "../components";

const HomeWrapper = styled.div`
  position: relative;
  bottom: px;

  video {
    width: 1440px;
  }

  .header {
    height: 100px;
  }
`;

export const Home: React.FC = () => {
  return (
    // @ts-ignore
    <HomeWrapper>
      <video src="video/mainVideo1.mp4" autoPlay={true} loop="loop" />
      <Categories />
    </HomeWrapper>
  );
};
